import React, { Component } from 'react';
import { func, number, string } from 'prop-types';

import './footer.css';
import TaskFilter from '../task-filter';

export default class Footer extends Component {
  defaultProps = {
    done: 0,
    statusFilter: 'All',
  };
  propTypes = {
    done: number,
    clearCompleted: func.isRequired,
    statusFilter: string,
    changeStatusFilter: func.isRequired,
  };
  render() {
    const { active, filterChange, clearCompleted, statusFilter } = this.props;
    return (
      <footer className="footer">
        <span className="todo-count">{active.length} items left</span>
        <TaskFilter filterChange={filterChange} statusFilter={statusFilter} />
        <button onClick={clearCompleted} className="clear-completed">
          Clear completed
        </button>
      </footer>
    );
  }
}
